import React from 'react';

function Categories() {
  return (
	<div class="col-lg-6 mb-4">
		<div class="card bg-info text-white shadow">
			<div class="card-body">
				<p>Category 01</p>
			</div>
		</div>
	</div>
    );
}

export default Categories;
